import React from 'react';
import { useNavigate } from 'react-router-dom';
import { authService } from '../../services/auth.service';
import {
  Box,
  Container,
  Typography,
  Grid,
  Card,
  CardContent,
  CardActions,
  Button,
  AppBar,
  Toolbar,
  IconButton
} from '@mui/material';
import HomeIcon from '@mui/icons-material/Home';
import NotificationsIcon from '@mui/icons-material/Notifications';
import PersonIcon from '@mui/icons-material/Person';
import PaymentIcon from '@mui/icons-material/Payment';
import HistoryIcon from '@mui/icons-material/History';
import FeedbackIcon from '@mui/icons-material/Feedback';
import LogoutIcon from '@mui/icons-material/Logout';

export const StudentHome: React.FC = () => {
  const navigate = useNavigate();
  const currentUser = authService.getCurrentUser();

  const handleLogout = () => {
    authService.logout();
    navigate('/login');
  };

  return (
    <Box>
      <AppBar position="static" color="default" elevation={0}>
        <Toolbar>
          <Box sx={{ flexGrow: 1 }} />
          <IconButton 
            color="inherit" 
            onClick={handleLogout}
            sx={{ 
              '&:hover': {
                color: 'error.main'
              }
            }}
          >
            <LogoutIcon />
          </IconButton>
        </Toolbar>
      </AppBar>

      <Container maxWidth="lg">
        <Box sx={{ mt: 4, mb: 4 }}>
          <Typography variant="h4" component="h1" gutterBottom align="center">
            Ký túc xá Sinh viên
          </Typography>
          <Typography 
            variant="subtitle1" 
            align="center" 
            color="text.secondary" 
            sx={{ 
              mb: 4,
              cursor: 'pointer',
              '&:hover': {
                color: 'primary.main',
                textDecoration: 'underline'
              }
            }}
            onClick={() => navigate('/student/profile')}
          >
            Chào mừng, {currentUser?.user.username}!
          </Typography>

          <Grid container spacing={3}>
            {/* Thông tin phòng */}
            <Grid item xs={12} sm={6} md={4}>
              <Card 
                sx={{ 
                  height: '100%',
                  display: 'flex',
                  flexDirection: 'column',
                  alignItems: 'center',
                  p: 2,
                  '&:hover': {
                    backgroundColor: 'rgba(0, 0, 0, 0.04)',
                    cursor: 'pointer'
                  }
                }}
                onClick={() => navigate('/student/room-info')}
              >
                <HomeIcon sx={{ fontSize: 48, color: 'primary.main', mb: 2 }} />
                <CardContent sx={{ textAlign: 'center' }}>
                  <Typography variant="h6" gutterBottom>
                    Thông tin phòng
                  </Typography>
                  <Typography variant="body2" color="text.secondary">
                    Xem thông tin phòng bạn đang ở
                  </Typography>
                </CardContent>
              </Card>
            </Grid>

            {/* Đăng ký phòng */}
            <Grid item xs={12} sm={6} md={4}>
              <Card 
                sx={{ 
                  height: '100%',
                  display: 'flex',
                  flexDirection: 'column',
                  alignItems: 'center',
                  p: 2,
                  '&:hover': {
                    backgroundColor: 'rgba(0, 0, 0, 0.04)',
                    cursor: 'pointer'
                  }
                }}
                onClick={() => navigate('/student/available-rooms')}
              >
                <PersonIcon sx={{ fontSize: 48, color: 'primary.main', mb: 2 }} />
                <CardContent sx={{ textAlign: 'center' }}>
                  <Typography variant="h6" gutterBottom>
                    Đăng ký phòng
                  </Typography>
                  <Typography variant="body2" color="text.secondary">
                    Đăng ký phòng ở mới hoặc thay đổi phòng
                  </Typography>
                </CardContent>
              </Card>
            </Grid>

            {/* Thông báo */}
            <Grid item xs={12} md={4}>
              <Card 
                sx={{ 
                  height: '100%',
                  display: 'flex',
                  flexDirection: 'column',
                  cursor: 'pointer',
                  '&:hover': {
                    boxShadow: 6
                  }
                }}
                onClick={() => navigate('/student/notifications')}
              >
                <CardContent sx={{ flexGrow: 1 }}>
                  <Box sx={{ display: 'flex', alignItems: 'center', mb: 2 }}>
                    <NotificationsIcon sx={{ fontSize: 40, color: 'primary.main', mr: 2 }} />
                    <Typography variant="h5" component="h2">
                      Thông báo
                    </Typography>
                  </Box>
                  <Typography>
                    Xem các thông báo mới nhất về thanh toán, phòng ở và các thông tin quan trọng khác.
                  </Typography>
                </CardContent>
                <CardActions>
                  <Button size="small" color="primary">Xem thông báo</Button>
                </CardActions>
              </Card>
            </Grid>

            {/* Thanh toán */}
            <Grid item xs={12} sm={6} md={4}>
              <Card 
                sx={{ 
                  height: '100%',
                  display: 'flex',
                  flexDirection: 'column',
                  alignItems: 'center',
                  p: 2,
                  '&:hover': {
                    backgroundColor: 'rgba(0, 0, 0, 0.04)',
                    cursor: 'pointer'
                  }
                }}
                onClick={() => navigate('/student/payment')}
              >
                <PaymentIcon sx={{ fontSize: 48, color: 'primary.main', mb: 2 }} />
                <CardContent sx={{ textAlign: 'center' }}>
                  <Typography variant="h6" gutterBottom>
                    Thanh toán
                  </Typography>
                  <Typography variant="body2" color="text.secondary">
                    Xem và thanh toán các khoản phí ký túc xá
                  </Typography>
                </CardContent>
              </Card>
            </Grid>

            {/* Lịch sử */}
            <Grid item xs={12} sm={6} md={4}>
              <Card 
                sx={{ 
                  height: '100%',
                  display: 'flex',
                  flexDirection: 'column',
                  alignItems: 'center',
                  p: 2,
                  '&:hover': {
                    backgroundColor: 'rgba(0, 0, 0, 0.04)',
                    cursor: 'pointer'
                  }
                }}
                onClick={() => navigate('/student/history')}
              >
                <HistoryIcon sx={{ fontSize: 48, color: 'primary.main', mb: 2 }} />
                <CardContent sx={{ textAlign: 'center' }}>
                  <Typography variant="h6" gutterBottom>
                    Lịch sử
                  </Typography>
                  <Typography variant="body2" color="text.secondary">
                    Xem lịch sử đăng ký phòng và thanh toán
                  </Typography>
                </CardContent>
              </Card>
            </Grid>
          </Grid>
        </Box>
      </Container>
    </Box>
  );
};
